class Solution {

    /**
     * @param Integer[] $nums
     * @return Boolean
     */
    function canTraverseAllPairs($nums) {
        $n = count($nums);
        $parent = range(0, $n - 1);

        $find = function ($x) use (&$parent, &$find) {
            return $x == $parent[$x] ? $x : $parent[$x] = $find($parent[$x]);
        };

        $union = function ($x, $y) use (&$parent, &$find) {
            $parent[$find($x)] = $find($y);
        };

        $gcd = function ($a, $b) use (&$gcd) {
            return $b ? $gcd($b, $a % $b) : $a;
        };

        for ($i = 0; $i < $n; $i++) {
            for ($j = $i + 1; $j < $n; $j++) {
                if ($gcd($nums[$i], $nums[$j]) > 1) {
                    $union($i, $j);
                }
            }
        }

        $root = $find(0);
        for ($i = 1; $i < $n; $i++) {
            if ($find($i) != $root) {
                return false;
            }
        }
        return true;
    }
}
